def add_to_timer(dt,prev_dt):
    from datetime import datetime
    dt = datetime.strptime(dt, "%Y.%m.%d %H:%M:%S")
    prev_dt = datetime.strptime(prev_dt, "%Y.%m.%d %H:%M:%S")
    delta = (dt-prev_dt)
    return delta.total_seconds()
