def dict_string_to_table(dct,sep1,sep2):
    output = {}
    for key in dct.keys():
        item = dct[key]
        output[key] = string_to_table(item,sep1,sep2)
    return output
def string_to_table (string,sep1,sep2):
    string = string.split(sep2)
    for i in range(len(string)):
        string[i] = string[i].split(sep1)
    return string
def format_order(order,current_prices):
    
    lst = []
    ticket = order[0]
    if order[2] == "buy":
        position = 1
    else:
        position = 0
    price = float(order[4])
    volume = float(order[3])
    symbol = ticket[:6]
    profit = calc_profit(symbol,position,price,volume,current_prices)
    if symbol == "EURUSD":
        magic = 100
    elif symbol == "USDCHF":
        magic = 200
    lst = [ticket,1,2,3,4,position,magic,7,8,volume,price,11,12,13,14,profit,symbol]
    return lst
def format_orders(orders,current_prices):
    lst = []
    for order in orders:
        if order != ['']:
            lst.append(format_order(order,current_prices))
    return lst
def calc_profit(symbol,position,price,volume,current_prices):
    current_price = current_prices[symbol]
    if position == 1:
        #BUY
        return volume*100000*(float(current_price["sell"]) - price)
    elif position == 0:
        #SELL
        return volume*100000*(price - float(current_price["buy"]))
def string_to_table (string,sep1,sep2):
    string = string.split(sep2)
    for i in range(len(string)):
        string[i] = string[i].split(sep1)
    return string
def dict_string_to_table(dct,sep1,sep2):
    output = {}
    for key in dct.keys():
        item = dct[key]
        output[key] = string_to_table(item,sep1,sep2)
    return output
def change_dt(dt,change):
    from datetime import datetime, timedelta
    dt = datetime.strptime(dt, "%Y.%m.%d %H:%M:%S")
    dt = dt + timedelta(minutes=change*5)
    return dt.strftime("%Y.%m.%d %H:%M:%S")
def interval(dt,status,prev_status,variables):
    import json
    if (prev_status == "regular" or prev_status == "restart") and (status == "full close" or status == "full close permanent") and variables["preset"] == True:
        with open("operations//intervals", 'r') as f:
            intervals = json.loads(f.read())
        intervals.append([change_dt(dt,-1),change_dt(dt,0),"full close"])
        with open("operations//intervals", 'w') as f:
            json.dump(intervals, f)
    if prev_status == "full close" and (status == "regular" or status == "restart") and variables["preset"] == True:
        with open("operations//intervals", 'r') as f:
            intervals = json.loads(f.read())
        intervals.append([change_dt(dt,-1),change_dt(dt,0),"restart"])
        with open("operations//intervals", 'w') as f:
            json.dump(intervals, f)
def update(dt,status):
    import json
    # M A I N T A I N I N G   B A S E   D I C T
    with open("merged//prices", 'r') as f:
        prices = json.loads(f.read())
    with open("operations//variables", 'r') as f:
        variables = json.loads(f.read())
    with open("merged//orders", 'r') as f:
        merged_orders = json.loads(f.read())
            
    interval(dt,status,variables["status"],variables)
    variables["dt"] = dt
    variables["status"] = status
    server_orders = variables["server_orders"]
    merged_orders = dict_string_to_table(merged_orders,"/",",")
    current_prices = prices[dt]
    variables["current_prices"] = current_prices
    prev_client_orders = variables["client_orders"]
    variables["prev_client_orders"] = prev_client_orders
    client_orders = format_orders(merged_orders[dt],current_prices)
    variables["client_orders"] = client_orders
    orders = client_orders+server_orders
    variables["orders"] = orders
    variables["prev_server_orders"] = server_orders
    #---
    display = {}
    display["dt"] = variables["dt"]
    display["status"] = status
    display["server_balance"] = variables["server_balance"]
    display["server_equity"] = variables["server_equity"]
    display["client_balance"] = variables["client_balance"]
    display["client_equity"] = variables["client_equity"]
    #----
    with open("operations//display", 'w') as f:
        json.dump(display, f)
    with open("operations//variables", 'w') as f:
        json.dump(variables, f)
def update_be(dt,status):
    import json
    with open("operations//variables", 'r') as f:
        variables = json.loads(f.read())
    # B E
    server_balance = variables["server_balance"]
    server_equity = variables["server_equity"]
    client_balance = variables["client_balance"]
    client_equity = variables["client_equity"]
    server_orders = variables["server_orders"]
    client_orders = variables["client_orders"]
    be_dct = {dt:{"server":[server_balance,server_equity,server_orders],"client":[client_balance,client_equity,client_orders],"status":status}}
    #be_dct = {dt:{"server":[len(server_orders),len(server_orders)],"client":[len(client_orders),len(client_orders)]}}
    with open("operations//be", 'a') as f:
        f.write(str(be_dct)+"\n")
def ms_timer(prev_ms):
    from datetime import datetime
    ms = datetime.now()
    date= ms - prev_ms
    seconds =(date.total_seconds())
    milliseconds = round(seconds*1000)
    return milliseconds, ms
def time_zone(dt,diff):
    from datetime import datetime, timedelta
    date = dt + timedelta(hours=diff)
    return date
def datetime():
    import json
    from datetime import datetime
    with open('operations//display', 'r') as f:
        display = json.loads(f.read())
    dt = datetime.strptime(display["dt"], "%Y.%m.%d %H:%M:%S")
    dt = time_zone(dt,8)
    return dt
